import React from 'react';
import {View, Text, Button, TouchableOpacity} from 'react-native';

export default function Home({navigation}) {
    const data = [
        {
            nome: "Restaurante 1",
            nota: 4.5,
            endereco: "Rua das Avenidas, 123",
            telefone: "1234-4321",
            horario: "08:00 ~ 17:00",
            imagem:''
        },
        {
            nome: "Restaurante 2",
            nota: 5,
            endereco: "Avenida das Ruas, 321",
            telefone: "4567-7654",
            horario: "18:00 ~ 23:00",
            imagem:''
        },
        {
            nome: "Restaurante 3",
            nota: 3.8,
            endereco: "Alameda dos Anjos, 5",
            telefone: "2135-7894",
            horario: "10:30 ~ 14:00",
            imagem:''
        }
        
    ]

    return (
        <View>
            {
                data.map((rest, index) => {
                    return (
                        <TouchableOpacity>
                            <Text>rest.nome</Text>
                            <Text>rest.nota</Text>
                        </TouchableOpacity>
                    );
                })
            }
        </View>
    );
}
